import { Heading, IconButton } from "theme-ui";

const HeaderInfo = () => {
  return (
    <div>
      <div>
        <Heading as="h3">Website</Heading>
        <IconButton aria-label="Toggle dark mode">
        <i className="far fa-question-circle"></i>
</IconButton>
      </div>
    </div>
  );
};

export default HeaderInfo;
